function objURL(url) {
    var ourl = url || window.location.href;
    var href = ""; //?前面部分
    var params = {}; //url参数对象
    var jing = ""; //#及后面部分
    var isRefresh = false;
    var init = function () {
        var str = ourl;
        var index = str.indexOf("#");
        while (index > 0) {
            jing = str.substr(index + 1);
            if (jing.indexOf("=") > 0) {
                isRefresh = true;
            }
            var unionStr = jing.indexOf("?") <= 0 ? "" : "&";
            str = str.substring(0, index) + unionStr + jing;
            index = str.indexOf("#");
        }
        index = str.indexOf("?");
        if (index > 0) {
            href = str.substring(0, index);
            str = str.substr(index + 1);
            var parts = str.split("&");
            for (var i = 0; i < parts.length; i++) {
                var kv = parts[i].split("=");
                params[kv[0].toLowerCase()] = kv[1];
            }
        } else {
            href = ourl;
            params = {};
        }
    };
    this.set = function (key, val) {
        key = key.toLowerCase();
        if (!!val) {
            params[key] = encodeURIComponent(val);
        } else {
            if (key in params) params[key] = undefined;
        }
    };
    this.remove = function (key) {
        key = key.toLowerCase();
        if (key in params) params[key] = undefined;
    };
    this.get = function (key) {
        key = key.toLowerCase();
        if (!!params[key]) {
            return decodeURIComponent(params[key]);
        }
    };
    this.url = function (key) {
        var strurl = href;
        var objps = [];
        for (var k in params) {
            if (params[k]) {
                objps.push(k + "=" + params[k]);
            }
        }
        if (objps.length > 0) {
            strurl += (isRefresh ? "?#" : "?") + objps.join("&");
        }
        //if (jing.length > 0) {
        //    strurl += jing;
        //}
        return strurl;
    };
    this.debug = function () {
        // 以下调试代码自由设置
        var objps = [];
        for (var k in params) {
            objps.push(k + "=" + params[k]);
        }
        alert(objps); //输出params的所有值
    };
    init();
}
var common = new Object({
    loadingBtn: null,
    showLoading: null,
    submitError: function (XMLHttpRequest) {
        if (XMLHttpRequest.status == 400) {
            this.getError(XMLHttpRequest.status + " error-页面凭证或已过期被拒绝,请刷新页面重试!");
        } else if (XMLHttpRequest.status == 404) {
            this.getError(XMLHttpRequest.status + " error-所访问的资源不存在!");
        } else {
            this.getError(XMLHttpRequest.status + " error-请联系:contact@cnblogs.com");
        }
    },
    getError: function (message) {
        $(".ajax-error").text("*" + message).show();       
    }
});
